    <style>

            .caption span.border {
                background-color: #111;
                color: #fff;
                padding: 18px;
                font-size: 25px;
                letter-spacing: 10px;
            }

        h3 {

            font: 20px "Lato", sans-serif;
            color: #111;
        }
    </style>
